import React from "react";
import Card from "./card";

const Cardlist = ({ services }) => {
    const cardcomponent = services.map((user, i) => {
        return <Card key={i} id={services[i].id} username={services[i].username} />
    });
    return(
        <div>
            {cardcomponent}
        </div>
    );
}

export default Cardlist;
